import { combineReducers } from 'redux'

const initialState = {
    data:[]
}

const products = (state = initialState, action) => {
    switch (action.type){
        case 'GET_DATA':
            return {
                ...state,
                data: action.payload
            }

        default:
            return state;
    }
}



export default combineReducers({ products })
